import axios from "axios";

abstract class ApiServiceAbstract {
  abstract readonly URL_USERS: string
  abstract readonly URL_POSTS: string

  abstract getUsers<T>(): Promise<T>
} 

export class ApiService extends ApiServiceAbstract{
  URL_USERS = "https://jsonplaceholder.typicode.com/users";
  URL_POSTS = "https://jsonplaceholder.typicode.com/posts";

  async getUsers<T>(): Promise<T> {
    return await axios.get(this.URL_USERS)
  }

  // async getPosts() {
  //   return await axios.get(this.URL_POSTS);
  // }
}
